import './Toggle.css';
import React from 'react';

function Toggle() {
  return (
    // <label className='toggle'>
    //   <input className='toggle__input' type='checkbox' />
    //   <span className='toggle__span'></span>
    // </label>

    <label class='switch'>
      <input type='checkbox' />
      <span class='slider round'></span>
    </label>
  );
}

export default Toggle;
